import React from "react";
// Style

import {Wrapper, Content, Text} from './HeroImage.style';

const HeroImage = ({image,title,text}) => (
    <Wrapper>
        <Content>
            <Text>
                <h1>{title}</h1>
                <p>{text}</p>
            </Text>
        </Content>
    </Wrapper>
);

export default HeroImage;
